import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';


class App extends Component {
    render() {
        return (
            <Container>
                <Row>
                    <Col md={4}>1</Col>
                    <Col md={4}>2</Col>
                    <Col md={4}>3</Col>
                </Row>



            </Container>
        )
    }
}

export default App
